pragma solidity ^0.8.8;
contract ArifFirstContract{
    string public str="Hello world!! i am learning BlockChain...";
    function displayVar(int i) public view  returns (int){
         return 3*i;
    }
    function SumOfTwo(int a,int b) public  view returns(int ){
        return a+b;
    }
       
    
}

